import React from 'react'

const CareersComponent = props => {

    return (
        <div key={props.id} id={props.id} className="p-4 p-md-5" style={{ fontFamily: "Arial", fontSize: "medium"}}>
            <div className="text-dark font-weight-bold d-flex flex-wrap mt-3" style={{ fontSize}}>
                {/* {props.careerTitle} */}
                Director
            </div>
            <div className="d-flex flex-wrap mt-3">
                <div className="mr-3">
                    <i className="vacancy-tooltip ion ion-md-business" title="department"></i>&nbsp;
                    {/* {props.department} */}
                    Admin
                </div>
                <div className="mr-3">
                    <i className="vacancy-tooltip ion ion-md-time text-primary" title="Employment"></i>&nbsp; 
                    {/* {props.employment} */}
                    FullTime
                </div>
            </div>
            <div className="mt-3 mb-4 d-flex flex-wrap">
            {/* {prop.description} */}
            asdasdasdasd
            </div>
            <button type="button" className="btn btn-primary btn-round d-flex flex-wrap mt-3">Learn More</button>
        </div>
        
    )
}

export default CareersComponent
